void mnx2mnxsrDriver::scanBegin ()
{
  yy_flex_debug = fTraceScanning;

  if (fScriptName.empty () || fScriptName == "-") {
    yyin = stdin;
  }

  else if (!(yyin = fopen (fScriptName.c_str (), "r")))
    {
      std::stringstream ss;

      char*
        errorString =
          mfStrErrorCString ();

      if (errorString != nullptr) {
        ss <<
          "cannot open " <<
          fScriptName << ": " <<
          errorString <<
          endl;

        mnx2mnxsrFileError (
          fScriptName,
          ss.str ());
      }
    }
}

void mnx2mnxsrDriver::scanEnd ()
{
  fclose (yyin);
}

